Add-Type -AssemblyName System.Windows.Forms
Add-Type -AssemblyName System.Drawing

# --- CONFIGURATION ---
$Server = "95.217.101.165:2302"  # IP masquée dans l'UI
$Name = ""
$DayZID = 221100
$QueryPort = 27016
$SteamRoot = "${env:ProgramFiles(x86)}\Steam"
$WorkshopDir = "$SteamRoot\steamapps\workshop\content\$DayZID"
$GameDir = "$SteamRoot\steamapps\common\DayZ"

# --- IMAGE DE FOND (base64 intégrée ici) ---
$imageBase64 = @"

"@  # 🔸 Mets ici ton image encodée en base64 JPG

$tempImage = "$env:TEMP\creality_bg.jpg"
[IO.File]::WriteAllBytes($tempImage, [Convert]::FromBase64String($imageBase64))

# --- UI MILITAIRE ---
$form = New-Object Windows.Forms.Form
$form.Text = "Creality DayZ Launcher"
$form.Size = New-Object Drawing.Size(500, 320)
$form.StartPosition = "CenterScreen"
$form.FormBorderStyle = 'FixedDialog'
$form.MaximizeBox = $false

$image = [System.Drawing.Image]::FromFile($tempImage)
$form.BackgroundImage = $image
$form.BackgroundImageLayout = 'Stretch'

$font = New-Object Drawing.Font("Consolas", 10, [Drawing.FontStyle]::Bold)

$banner = New-Object Windows.Forms.Label
$banner.Text = ">>> CREALITY DAYZ <<<"
$banner.Font = New-Object Drawing.Font("Consolas", 16, [Drawing.FontStyle]::Bold)
$banner.ForeColor = 'White'
$banner.BackColor = 'Black'
$banner.AutoSize = $false
$banner.TextAlign = 'MiddleCenter'
$banner.Size = New-Object Drawing.Size(460, 40)
$banner.Location = New-Object Drawing.Point(10, 10)
$form.Controls.Add($banner)

$nameLabel = New-Object Windows.Forms.Label
$nameLabel.Text = "Pseudo In-Game :"
$nameLabel.ForeColor = 'White'
$nameLabel.BackColor = 'Transparent'
$nameLabel.Location = New-Object Drawing.Point(30, 65)
$nameLabel.Size = New-Object Drawing.Size(120, 20)
$form.Controls.Add($nameLabel)

$nameBox = New-Object Windows.Forms.TextBox
$nameBox.Text = $Name
$nameBox.Font = $font
$nameBox.Location = New-Object Drawing.Point(160, 62)
$nameBox.Width = 280
$form.Controls.Add($nameBox)

$logBox = New-Object Windows.Forms.TextBox
$logBox.Multiline = $true
$logBox.Font = $font
$logBox.BackColor = 'Black'
$logBox.ForeColor = 'Lime'
$logBox.ReadOnly = $true
$logBox.BorderStyle = 'Fixed3D'
$logBox.Location = New-Object Drawing.Point(30, 100)
$logBox.Size = New-Object Drawing.Size(410, 80)
$form.Controls.Add($logBox)

$launchBtn = New-Object Windows.Forms.Button
$launchBtn.Text = "REJOINDRE LE FRONT"
$launchBtn.Font = New-Object Drawing.Font("Consolas", 10, [Drawing.FontStyle]::Bold)
$launchBtn.BackColor = 'DarkGreen'
$launchBtn.ForeColor = 'White'
$launchBtn.Location = New-Object Drawing.Point(320, 200)
$launchBtn.Size = New-Object Drawing.Size(160, 30)
$form.Controls.Add($launchBtn)

function Log($text) {
    $logBox.AppendText("`n$text")
}

# --- ACTION ---
$launchBtn.Add_Click({
    $Name = $nameBox.Text

    if ([string]::IsNullOrWhiteSpace($Name)) {
        Log "⚠️ Merci d'entrer un pseudo avant de rejoindre."
        return
    }

    Log "Bonjour $Name, bienvenue sur Creality DayZ !"

    $ApiUrl = "https://dayzsalauncher.com/api/v1/query/{0}/{1}" -f ($Server.Split(":")[0]), $QueryPort
    Log "Requête serveur..."
    try {
        $response = Invoke-RestMethod -Uri $ApiUrl -TimeoutSec 10 -Headers @{ "User-Agent" = "dayz-windows-launcher" }
        $mods = $response.result.mods | Select-Object -ExpandProperty steamWorkshopId
        if ($mods.Count -eq 0) {
            Log "Aucun mod détecté."
            return
        }

        $modManquant = $false
		$modLinks = @()

		foreach ($id in $mods) {
			$modPath = Join-Path $WorkshopDir $id
			if (-Not (Test-Path $modPath)) {
				Log "❗ Mod $id manquant. Abonne-toi sur Steam."
				$modManquant = $true
				break
			}

			$Bytes = [BitConverter]::GetBytes([UInt32]::Parse($id))
			$Base64 = [Convert]::ToBase64String($Bytes).TrimEnd("=").Replace('+','_').Replace('/','-')
			$LinkName = "@$Base64"
			$LinkPath = Join-Path $GameDir $LinkName

			if (-Not (Test-Path $LinkPath)) {
				New-Item -ItemType SymbolicLink -Path $LinkPath -Target $modPath | Out-Null
				Log "⛓️ Lien créé : $LinkName"
			}

			$modLinks += $LinkName
		}

		if ($modManquant) {
			Log "❌ Impossible de lancer le jeu : mod(s) manquant(s)."
			return
		}

            $Bytes = [BitConverter]::GetBytes([UInt32]::Parse($id))
            $Base64 = [Convert]::ToBase64String($Bytes).TrimEnd("=").Replace('+','_').Replace('/','-')
            $LinkName = "@$Base64"
            $LinkPath = Join-Path $GameDir $LinkName

            if (-Not (Test-Path $LinkPath)) {
                New-Item -ItemType SymbolicLink -Path $LinkPath -Target $modPath | Out-Null
                Log "⛓️ Lien créé : $LinkName"
            }

            $modLinks += $LinkName
        }

        $ModsStr = ($modLinks -join ";")
        $Args = "-mod=$ModsStr -connect=$Server -name=$Name -world=empty"

        $GameExe = "$GameDir\DayZ_BE.exe"
        if (-Not (Test-Path $GameExe)) {
            Log "❌ DayZ_BE.exe introuvable."
            return
        }

        Log "✅ Lancement de DayZ avec BattleEye..."
		Start-Process -FilePath $GameExe -ArgumentList $Args

		for ($i = 10; $i -ge 1; $i--) {
			if ($i -eq 10) {
				$logBox.AppendText("`nFermeture du launcher dans $i...")
			} else {
				$logBox.AppendText("`n$i")
			}
			Start-Sleep -Seconds 1
		}
		$form.Close()

    } catch {
        Log "❌ Erreur : $_"
    }
})

[void]$form.ShowDialog()
